def kth_smallest_factor(N: int, K: int) -> int:
    factors = []
    for i in range(1, int(N ** 0.5) + 1):
        if N % i == 0:
            factors.append(i)
            if i != N // i:
                factors.append(N // i)
    factors.sort()
    if K >= len(factors):
        return -1
    else:
        return factors[K - 1]

